import React from 'react';
import './project.css';

class Project extends React.Component{
    constructor(){
        super();
        this.state={
            projects: 'Project Link'
        }
    }
    render(){
        return(
            <div className='projects'>
                <div>Project 1</div>
                <div>Project 2</div>
                <div>Project 3</div>
            </div>
        );
    }
}

export default Project;
